import './section2.css';
import Divs from './divs';
import Img1 from './fast_delivery.png'
import Img2 from './live_order.png'
import Img3 from './min_order.png'

const section2 = () => {

    return ( 
        <div className="section2">
            <Divs imgSrc={Img3} h2Text={''}/>
            <Divs imgSrc={Img2}/>
            <Divs imgSrc={Img1}/>
        </div>
     );
}

export default section2;
